      const newValue = toUpdate.nickName;
      user = await UserModel.update({ _id: id, fieldToUpdate, newValue });
    }

    if (toUpdate.email) {
      const fieldToUpdate = "email";
      const newValue = toUpdate.email;
      user = await UserModel.update({ _id: id, fieldToUpdate, newValue });
    }

