      const fieldToUpdate = "password";
      const newValue = await bcrypt.hash(toUpdate.password, 10);
      user = await UserModel.update({ _id: id, fieldToUpdate, newValue });
    }

    if (toUpdate.address) {
      const fieldToUpdate = "address";
      const newValue = toUpdate.address;
      user = await UserModel.update({ _id: id, fieldToUpdate, newValue });
    }

    return user;
